import React from 'react';
import './navbar.css';
import {  NavLink, Route,Routes } from "react-router-dom";
export default function NavBar(){
    return(
        <>
            <Routes>
            <Route to='/' activeStyle>
                <h2>Home</h2>
            </Route>
            <Route to='/About' activeStyle>
                <h2>About</h2>
            </Route>
            <Route to='/Contact' activeStyle>
                <h2>Contact</h2>
            </Route>
            
            </Routes>
        
        </>
    );
}
